                    </g>
                </svg>
                
            </div>
            <div className={styles.contents}>
            <div className={styles.username}>{username}</div>
            <span className={styles.twwet_count}>{`${tweet_count} 트윗`}</span>

            </div>
            
        </div>
    )

}

export default Header;
